var x = d3.scaleTime().range([0, width]),

var area = d3.area()

    .y1(function(d) { return y(d.total); });

var area2 = d3.area()
    .curve(d3.curveMonotoneX)

    .y0(height2)
    .y1(function(d) { return y2(d.total); });

		feMerge = filter.append('feMerge'),
		feMergeNode_1 = feMerge.append('feMergeNode').attr('in','coloredBlur'),
		feMergeNode_2 = feMerge.append('feMergeNode').attr('in','SourceGraphic');

svg.append("defs").append("clipPath")

var focus = svg.append("g")

var focusLine=focus.append('line')

		  .attr('x2', 0)
		  .attr('y2', height)
		  .attr('stroke', '#222')
		  .attr('stroke-dasharray', '1, 2');
var context = svg.append("g")
				.attr("class", "context")
				.attr("transform", "translate(" + margin2.left + "," + margin2.top + ")");
var display_range_group = svg.append("g")
					.attr("id", "buttons_group")
					.attr("transform", "translate(" + 0 + ","+ 0 +")");

var expl_text = display_range_group.append("text")
   // .text("Showing data from: ")
    .style("text-anchor", "start")
    .attr("transform", "translate(" + 0 + ","+ 10 +")");

display_range_group.append("text")
    .attr("id", "displayDates")
    //.text('10-01-2013' + " - " + '10-01-2014')
    .style("text-anchor", "start")
    .attr("transform", "translate(" + 82 + ","+ 10 +")");

var expl_text = display_range_group.append("text")
    .text("Zoom to : ")
    .style("text-anchor", "start")
    .attr("transform", "translate(" + width/2.1 + ","+ 15 +")");


var button_width = 65;
var button_height = 22;
var dataXrange=x2.domain();

var dateRange  = dataXrange[1] - dataXrange[0],
    ms_in_year = 300000;

if (dateRange < ms_in_year)   {
    var button_data =["1 Min","data"];
} else {
    var button_data =["5 Mins","15 Mins","30 Mins","1 Hour" ,"6 Hours","12 Hours","24 Hours"];
};

var button = display_range_group.selectAll("g")
    .data(button_data)
    .enter().append("g")
    .attr("class", "scale_button")
    .attr("transform", function(d, i) { return "translate(" + ((width/1.8 )+ i*button_width + i*20) + ",0)"; })
    .on("click", function(d,i){
		scaleDate(d,i);
		d3.selectAll('.scale_button').style('fill','#222');
		d3.select(this).style('fill','#cb3f3f');
	});

button.append("rect")
    .attr("width", button_width)
    .attr("height", button_height)
    .attr("rx", 1)
    .attr("ry", 1);

button.append("text")
    .attr("dy", (button_height/2 + 3))
    .attr("dx", button_width/2)
    .style("text-anchor", "middle")
    .text(function(d) { return d; });
	data=graphData;
  x.domain(d3.extent(data, function(d) { return d.date; }));
  y.domain([0, d3.max(data, function(d) { return d.total; })]);
  x2.domain(x.domain());
  y2.domain(y.domain());
  var path =focus.append("path")
      .datum(data)
      .attr("class", "area")
      .attr("d", area)
	  .style("filter" , "url(#glow)");

  focus.append("g")
      .attr("class", "axis axis--x")
      .attr("transform", "translate(0," + height + ")")
      .call(xAxis);

 var axisY= focus.append("g")
      .attr("class", "axis axis--y")
      .call(yAxis);
	axisY.append("text")
			.attr("transform", "rotate(-90)")
			.attr("x", -height / 2)
			.attr("dy", "-4em")
			.style("text-anchor", "middle")
			.style('font-weight', 'bold')
			.style("fill", "#222")
			.style("font-size", "11px")
			.text("LPG Usage (grams)");
  var path2=context.append("path")
      .datum(data)
      .attr("class", "area")
      .attr("d", area2)
	  .style("filter" , "url(#glow)");

  context.append("g")
      .attr("class", "axis axis--x")
      .attr("transform", "translate(0," + height2 + ")")
      .call(xAxis2);

  context.append("g")
      .attr("class", "brush")
      .call(brush)
      .call(brush.move, x.range());

  var tipBox=svg.append("rect")
      .attr("class", "zoom")
      .attr("width", width)
      .attr("height", height)
      .attr("transform", "translate(" + margin.left + "," + margin.top + ")")
      .call(zoom);

var brushValue;
function brushed() {
	
  if (d3.event.sourceEvent && d3.event.sourceEvent.type === "zoom") return; // ignore brush-by-zoom
  var s = d3.event.selection || x2.range();
	brushValue=s;
  x.domain(s.map(x2.invert, x2));
  focus.select(".area").attr("d", area);
  focus.select(".axis--x").call(xAxis);
  svg.select(".zoom").call(zoom.transform, d3.zoomIdentity
      .scale(width / (s[1] - s[0]))
      .translate(-s[0], 0));
	  
}

function zoomed() {
  if (d3.event.sourceEvent && d3.event.sourceEvent.type === "brush") return; // ignore zoom-by-brush
  var t = d3.event.transform;
  x.domain(t.rescaleX(x2).domain());
  focus.select(".area").attr("d", area);
  focus.select(".axis--x").call(xAxis);
  context.select(".brush").call(brush.move, x.range().map(t.invertX, t));
}
function scaleDate(d,i) {
	var mindate=d3.min(graphData, function(d) { return d.date; });
var maxdate=d3.max(graphData, function(d) { return d.date; });

    var b = brush.extent(),
        interval_ms,
        brush_end_new,
        brush_start_new;
	b=x2.domain();
    if      (d == "5 Mins")   { interval_ms = 300000}
    else if (d == "15 Mins")  { interval_ms = 900000 }
    else if (d == "30 Mins")  { interval_ms = 1800000 }
    else if (d == "1 Hour")  { interval_ms = 3600000 }
    else if (d == "6 Hours")  { interval_ms = 21600000 }
    else if (d == "12 Hours")  { interval_ms = 43200000 }
    else if (d == "24 Hours")  { interval_ms = 86400000 };

    if ( d == "5 Mins" || d == "15 Mins" || d == "30 Mins"  || d == "1 Hour" || d == "6 Hours"|| d == "12 Hours")  {

        if((maxdate.getTime() - b[1].getTime()) < interval_ms){
            brush_start_new = new Date(maxdate.getTime() - interval_ms); // ...then decrease the left-hand brush boundary...
            brush_end_new = maxdate; //...and set the right-hand brush boundary to the maxiumum limit.
        } else {
            brush_start_new = b[0];
			brush_end_new = b[1]
        };

    } else if(d == "24 Hours") {
            brush_start_new = b[0];
			brush_end_new = b[1]
        } else {
        brush_start_new = b[0];
        brush_end_new = b[1];
    };

    brush.extent([brush_start_new, brush_end_new]);
   context.select(".brush").transition().duration(100).call(brush.move, [x2(brush_start_new),x2(brush_end_new)]);
};
function type(d) {
  d.date = parseDate(d.date);
  d.total = +d.total;
  return d;
}
var index=1000;
function update(){
	if(index<coreData.length){
				graphData.push(coreData[index]);
				index=index+1;
				graphData.shift();
			}
	x.domain(d3.extent(graphData,function(d){return d.date;}));
	x2.domain(d3.extent(graphData,function(d){return d.date;}));
	y.domain([0, d3.max(graphData, function(d) { return d.total; })]);
	y2.domain([0, d3.max(graphData, function(d) { return d.total; })]);
	focus.select(".axis--x").call(xAxis);
	context.select(".axis--x").call(xAxis2);
	focus.select(".axis--y").call(yAxis);
	 focus.select(".area").attr("d", area);
	 context.select(".area").attr("d", area2);
			path.transition()
				.duration(1000)
				.ease(d3.easeLinear)
			path2.transition()
				.duration(1000)
				.ease(d3.easeLinear);
	x.domain(brushValue.map(x2.invert, x2));
	var dates=x.domain();
	var ydomainData=coreData.filter(function(d){
		return d.date>=dates[0] && d.date<=dates[1]
	});
	y.domain([0,d3.max(ydomainData,function(d){return d.total;})]);
	  focus.select(".area").attr("d", area);
	  focus.select(".axis--x").call(xAxis);
	  focus.select(".axis--y").call(yAxis);
	  svg.select(".zoom").call(zoom.transform, d3.zoomIdentity
		  .scale(width / (brushValue[1] - brushValue[0]))
		  .translate(-brushValue[0], 0));
	tipBox.on("mouseout", function() { 
					removeTooltip();
					focusLine.style('display','none');
				  })
				  .on("mousemove", mousemove);
	var bisectDate = d3.bisector(function(d) { return new Date(d.dateTime); }).left;
	function removeTooltip() {
			  if (tooltip) tooltip.style('display', 'none');
			}

    function mousemove() {

	var x0 = x.invert(d3.mouse(this)[0]),
        i = bisectDate(graphData, x0, 1),
        d0 = graphData[i - 1],
        d1 = graphData[i],
        d = x0 - d0.dateTime > d1.dateTime - x0 ? d1 : d0;
		focusLine.style('display', 'block');
		focusLine.attr("transform", "translate(" + x(x0) + ",0)");
		var date = formatDate(x0);
		var date2 = formatDate2(x0);
		var tooltipData=graphData.filter(function(v){
			return v.dateTime==date;
		});
		if(tooltipData.length>0){
			for (key in graphData[0]) {
			  if (key !== 'dateTime') {
				tooltip.style('opacity', '1').style('display', 'inline');
				tooltip.html('<div id="tooltipBox" align="left" class="col">'+
					'<span class="row-md-3" style="margin:5;">'+date2+'</span>'+
					'</br>'+'<span class="row-md-3" ><strong>LPG Usage :</strong> '+d3.format('.1f')(tooltipData[0].total)+' grams'+'</span>'+'</div>')
						 .style('left', (d3.event.pageX + 10) + 'px')
						.style('top', (d3.event.pageY - 52) + 'px');

				}
			}
		}
	}
}
setInterval(update,1000);
}
setTimeout(consumerInfo,1000);
